allow-lan: true
# mode: global

bind-address: "*"
ipv6: false
log-level: info
find-process-mode: always
enable-process: true
unified-delay: true
keep-alive-interval: 15
tcp-concurrent: true
geodata-mode: true

external-controller: 0.0.0.0:9090
external-ui: ui
external-ui-url: "https://github.com/MetaCubeX/metacubexd/archive/refs/heads/gh-pages.zip"
global-client-fingerprint: chrome
geo-auto-update: true
geo-update-interval: 24
global-ua: clash.meta
profile:
  store-selected: true
  store-fake-ip: true
experimental:
  quic-go-disable-gso: false
  quic-go-disable-ecn: false
sniffer:
  enable: false
  sniff:
    HTTP:
      ports: [80, 8080-8880]
      override-destination: true
    TLS:
      ports: [443, 8443]
    QUIC:
      ports: [443, 8443]
  skip-domain:
    - "Mijia Cloud"
tun:
  enable: true
  stack: mixed
  dns-hijack:
    - 'any:53'
  auto-route: true
  auto-detect-interface: true
dns:
  enable: true
  use-hosts: true
  ipv6: false
  remote-dns-resolve: false# default value is true
  enhanced-mode: fake-ip # redir-host # fake-ip
  fake-ip-range: 28.0.0.0/16
  listen: 0.0.0.0:1053
  nameserver-policy:
    '+.example.com': 192.168.1.254
  default-nameserver:
     - 114.114.114.114
    - 119.29.29.29
    - 119.28.28.28
    - 8.8.8.8
    - tls://1.12.12.12:853
    - tls://223.5.5.5:853
